-- ----------------------------
-- Function structure for getDictChildList
-- ----------------------------
DROP FUNCTION IF EXISTS `getDictChildList`;
delimiter ;;
CREATE DEFINER=`sangoes`@`localhost` FUNCTION `getDictChildList`(id BIGINT) RETURNS varchar(4000) CHARSET utf8mb4
BEGIN
	DECLARE teamp VARCHAR(4000);
	DECLARE teampChild VARCHAR(4000);
	SET teamp='$';
	SET teampChild = CAST(id AS CHAR);
	WHILE teampChild IS NOT NULL DO
		SET teamp= CONCAT(teamp,',',teampChild);
		SELECT GROUP_CONCAT(d.id) INTO teampChild FROM dict AS d WHERE FIND_IN_SET(d.parent_id,teampChild)>0;
	END WHILE;
	RETURN teamp;
END;
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
